import React from "react";
import '../index.css';
import TableItem from './TableItem'

function Table(props) {
    return (
        <table className="result">
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
        <tr>
        {props.items.map((calculation) => (
            <TableItem 
            key={calculation.year}
            year={calculation.year}
            totalSavings={calculation.totalSavings}
            yearlyInterest={calculation.yearlyInterest}
            totalInterest={calculation.yearlyContibution - calculation.yearlyInterest - calculation.totalSavings}
            yearlyContibution={calculation.yearlyContibution}
            />
        ))}
        </tr>
          
        </tbody>
      </table>
    )
}

export default Table;
